import{_ as e}from"./chunks/log_download.BSfsCXzz.js";import{_ as t,c as o,o as a,ab as r}from"./chunks/framework.CUflZczI.js";const _=JSON.parse('{"title":"飞行报告","description":"","frontmatter":{},"headers":[],"relativePath":"zh/getting_started/flight_reporting.md","filePath":"zh/getting_started/flight_reporting.md"}'),i={name:"zh/getting_started/flight_reporting.md"},l=r('<h1 id="飞行报告" tabindex="-1">飞行报告 <a class="header-anchor" href="#飞行报告" aria-label="Permalink to &quot;飞行报告&quot;">​</a></h1><p>PX4 logs detailed aircraft state and sensor data, which can be used to analyze performance issues. This topic explains how you can download and analyse logs, and share them with the development team for review.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Keeping flight logs is a legal requirement in some jurisdictions.</p></div><h2 id="从飞行控制器下载日志" tabindex="-1">从飞行控制器下载日志 <a class="header-anchor" href="#从飞行控制器下载日志" aria-label="Permalink to &quot;从飞行控制器下载日志&quot;">​</a></h2><p>Logs can be downloaded using <a href="http://qgroundcontrol.com/" target="_blank" rel="noreferrer">QGroundControl</a>: <strong><a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/analyze_view/log_download.html" target="_blank" rel="noreferrer">Analyze View &gt; Log Download</a></strong>.</p><p><img src="'+e+'" alt="Flight Log Download"></p><h2 id="分析日志" tabindex="-1">分析日志 <a class="header-anchor" href="#分析日志" aria-label="Permalink to &quot;分析日志&quot;">​</a></h2><p>Upload the log file to the online <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a> tool. After upload you&#39;ll be emailed a link to the analysis page for the log.</p><p><a href="./../log/flight_review.html">Log Analysis using Flight Review</a> explains how to interpret the plots, and can help you to verify/reject the causes of common problems: excessive vibration, poor PID tuning, saturated controllers, imbalanced vehicles, GPS noise, etc.</p><div class="info custom-block"><p class="custom-block-title">There are many other great tools for visualising and analysing PX4 Logs. For more information see: <a href="./../dev_log/flight_log_analysis.html">Flight Analysis</a>.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>If you have a constant high-rate MAVLink connection to the vehicle (not just a telemetry link) then you can use <em>QGroundControl</em> to automatically upload logs directly to <em>Flight Review</em>. For more information see <a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/settings_view/mavlink.html#logging" target="_blank" rel="noreferrer">Settings &gt; MAVLink Settings &gt; MAVLink 2 Logging (PX4 only)</a>.</p></div><h2 id="给-px4-开发人员共享日志文件" tabindex="-1">给 PX4 开发人员共享日志文件 <a class="header-anchor" href="#给-px4-开发人员共享日志文件" aria-label="Permalink to &quot;给 PX4 开发人员共享日志文件&quot;">​</a></h2><p>The <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a> log file link can be shared for discussion in the <a href="./../contribute/support.html#forums-and-chat">support forums</a> or a <a href="./../#reporting-bugs-issues">Github issue</a>.</p><h2 id="log-configuration" tabindex="-1">Log Configuration <a class="header-anchor" href="#log-configuration" aria-label="Permalink to &quot;Log Configuration&quot;">​</a></h2><p>The logging system is configured by default to collect sensible logs for use with <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a>.</p><p>Logging may further be configured using the <a href="./../advanced_config/parameter_reference.html#sd-logging">SD Logging</a> parameters or with a file on the SD card. Details on configuration can be found in the <a href="./../dev_log/logging.html#configuration">logging configuration documentation</a>.</p><h2 id="主链接" tabindex="-1">主链接 <a class="header-anchor" href="#主链接" aria-label="Permalink to &quot;主链接&quot;">​</a></h2><ul><li><a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a></li><li><a href="./../log/flight_review.html">使用 Flight Review 进行日志分析</a></li><li><a href="./../dev_log/flight_log_analysis.html">飞行日志分析</a></li></ul>',18),n=[l];function s(g,h,c,d,p,f){return a(),o("div",null,n)}const b=t(i,[["render",s]]);export{_ as __pageData,b as default};
